import styled from "styled-components";

export const LinkingWrapper = styled.div`
    ul{
        display: flex;
        align-items: center;
        justify-content: center;
        list-style-type: none;
    }
    li{
        font-weight: bold;
        font-size: 24px;
        padding: 20px;
        position: relative;
    }
    a{
        text-decoration: none;
        color: black;
    }
`
